      &#1058;&#1077;&#1082;&#1089;&#1090; &#1087;&#1086;&#1089;&#1090;&#1072; &#1074;&#1099; &#1087;&#1080;&#1096;&#1080;&#1090;&#1077; &#1089;&#1072;&#1084;&#1080;, &#1085;&#1086; &#1087;&#1077;&#1088;&#1077;&#1076; &#1087;&#1091;&#1073;&#1083;&#1080;&#1082;&#1072;&#1094;&#1080;&#1077;&#1081; &#1087;&#1088;&#1080;&#1089;&#1099;&#1083;&#1072;&#1077;&#1090;&#1077; &#1077;&#1075;&#1086; &#1085;&#1072; &#1089;&#1086;&#1075;&#1083;&#1072;&#1089;&#1086;&#1074;&#1072;&#1085;&#1080;&#1077; &#1084;&#1085;&#1077;. &#1042; &#1085;&#1077;&#1084; &#1076;&#1086;&#1083;&#1078;&#1085;&#1086; &#1073;&#1099;&#1090;&#1100; &#1091;&#1087;&#1086;&#1084;&#1080;&#1085;&#1072;&#1085;&#1080;&#1077; &#1084;&#1086;&#1077;&#1075;&#1086; &#1072;&#1082;&#1082;&#1072;&#1091;&#1085;&#1090;&#1072; (&#1080; &#1085;&#1080;&#1082;&#1072;&#1082;&#1080;&#1093; &#1091;&#1087;&#1086;&#1084;&#1080;&#1085;&#1072;&#1085;&#1080;&#1081; &#1076;&#1088;&#1091;&#1075;&#1080;&#1093; &#1072;&#1082;&#1082;&#1072;&#1091;&#1085;&#1090;&#1086;&#1074;), &#1080; &#1086;&#1090;&#1084;&#1077;&#1090;&#1082;&#1072; &#1084;&#1086;&#1077;&#1075;&#1086; &#1072;&#1082;&#1082;&#1072;&#1091;&#1085;&#1090;&#1072; &#1085;&#1072; &#1092;&#1086;&#1090;&#1086;.
